                        <img src='/image/team.jpg' alt='team' style={{width:'35vw'}}></img>
                        <div  style={{width:'35vw', backgroundColor:'lightgrey'}}></div>
                    </div>
                <div className='container'>
                    
                </div>      

            </div>
        )
    }
}

export default About;
